#include <iostream>
#include <vector>
#include <algorithm>
#include <string>
#include <queue>

using namespace std;

class Solution 
{
public:


	struct set_point
	{
		int i, j;
		set_point* parent;

		set_point(int i, int j) : i(i), j(j), parent(this)
		{

		}
	};

	set_point* make_set(int i, int j)
	{
		return new set_point(i, j);
	}

	set_point* find(set_point* x)
	{
		if (x == NULL)
			return NULL;

		if (x != x->parent)
			x->parent = find(x->parent);

		return x->parent;
	}


	void union_set(set_point* a, set_point* b, int r, int c)
	{
		link(find(a), find(b), r, c);
	}

	void link(set_point* x, set_point* y, int r, int c)
	{
		if (x == y)
			return;

		if (x->i == 0 || x->j == 0 || x->i == r - 1 || x->j == c - 1)
		{
			y->parent = x;
		}
		else
		{
			x->parent = y;
		}
	}

	

	void solve(vector<vector<char>>& board) 
	{
		if (board.size() <= 0 || board[0].size() <= 0)
			return;

		
		vector<vector<set_point*>> sets(board.size(), vector<set_point*>(board[0].size()));


		for (int i = 0, j = 0; i < board.size(); i++)
		{
			if (board[i][j] == 'O')
				sets[i][j] = make_set(i, j);
		}

		for (int j = 0, i = 0; j < board[0].size(); j++)
		{
			if (board[i][j] == 'O')
				sets[i][j] = make_set(i, j);
		}

		for (int i = 1; i < board.size(); i++)
		{
			for (int j = 1; j < board[0].size(); j++)
			{
				if (board[i][j] == 'O')
				{
					sets[i][j] = make_set(i, j);
					if (board[i - 1][j] == 'O')
					{
						union_set(sets[i - 1][j], sets[i][j], board.size(), board[0].size());
					}

					if (board[i][j - 1] == 'O')
					{
						union_set(sets[i][j - 1], sets[i][j], board.size(), board[0].size());
					}
				}
			}
		}


		for (int i = 0; i < board.size(); i++)
		{
			for (int j = 0; j < board[0].size(); j++)
			{
				set_point* rep = find(sets[i][j]);
				if (rep && rep->i != 0 && rep->j != 0 && rep->i != board.size() - 1 && rep->j != board[0].size() - 1)
					board[i][j] = 'X';
			}
		}
	}
};

vector<vector<char>> get_vec(vector<string>& v)
{
	vector<vector<char>> res (v.size(), vector<char>(v[0].length()));

	for (int i = 0; i < v.size(); i++)
	{
		for (int j = 0; j < v[i].length(); j++)
			res[i][j] = v[i][j];
	}

	return move(res);
}

